"markdown","source":"There are so many outliers in our dataset, that it is impossible for us to fully visualise the boxplot image. This is not a surprise since the housing market has such a large range prices. Depending on the house size and/or location, price may vary. I have decided to slightly change the graph to have a better view of the data","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\n# Calculate the range of the y-axis to include more data\ny_min <- quantile(df$price, 0.05)  # Set lower limit to the 5th percentile\ny_max <- quantile(df$price, 0.95)  # Set upper limit to the 95th percentile\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = price)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"Price\", title = \"Interquartile Range Plot of price outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(y_min, y_max) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )\n","metadata":{"execution":{"iopub.status.busy":"2024-03-10T04:47:21.677843Z","iopub.execute_input":"2024-03-10T04:47:21.679592Z","iopub.status.idle":"2024-03-10T04:47:29.148715Z"},"trusted":true},"execution_count":88,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 244860 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ4BU1d0H4Lt9adJ7EVGKBQs2omIJiL1GRUUNiB1jjK/G2BKj0Rh7bLFXRE2s\naOwKgiYWLKgBVAQVKdJhWdg+74fdHVbYnV2W2QLneT6dnXvmzrnzv3NH58e5JyUWi0UAAAAA\nAABAGFIbegAAAAAAAABA/REQAg