me changes to the graph's options, it is now visible to us that the is a large price range price for all of the houses listed. The graph also inform us that the house's at a price range between $ 100,000 - $ 1.25M, and an average house price close to $ 375,000.","metadata":{}},{"cell_type":"markdown","source":"The many red dots in the plot above shows us how many outliers are present in your dataset. The above datapoints demonstrate how the house market includes many luxurious houses.","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = bed)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"Bed\", title = \"Interquartile Range Plot of Bed outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(0, 20) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )","metadata":{"execution":{"iopub.status.busy":"2024-03-10T05:10:16.487135Z","iopub.execute_input":"2024-03-10T05:10:16.488862Z","iopub.status.idle":"2024-03-10T05:10:20.804293Z"},"trusted":true},"execution_count":97,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 1152 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzddYBU5d4H8LPLsrt0g6SKErZiYSAqiN2BioFit/fada957bh67Ra744IN1nsN\nbAUsDEK6d9me949dBoTZ2ZoNeD6fv56Z88yZ58zvnDPLfHnOSYvFYhEAAAAAAAAQhvT6HgAA\nAAAAAABQdwSEAAAAAAAAEBABIQAAAAAAAAREQAgAAAAAAAABERACAAAAAABAQASEAAAAAAAA\nEBABIQAAAAAAAAREQAgAAAAAAAABERACAAAAAAB