tain any bedrooms. While, the average house has 3 bedrooms, houses having up to 7 bedrooms are considered within normal range.","metadata":{}},{"cell_type":"code","source":"# Increase plot size\noptions(repr.plot.width=20, repr.plot.height=7)\n\n\n# Create interquartile range plot with larger size, horizontal orientation, and adjusted y-axis scale\nggplot(df, aes(x = \"\", y = bath)) +\n    geom_boxplot(fill = \"skyblue\", color = \"black\", outlier.color = \"red\") + \n    theme_minimal() +  \n    labs(x = \"\", y = \"Bath\", title = \"Interquartile Range Plot of Bath outliers\") +\n    coord_flip() +  # Flip the coordinates to make the plot horizontal\n    ylim(0, 20) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )","metadata":{"execution":{"iopub.status.busy":"2024-03-10T05:18:05.620701Z","iopub.execute_input":"2024-03-10T05:18:05.622395Z","iopub.status.idle":"2024-03-10T05:18:09.620681Z"},"trusted":true},"execution_count":98,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 535 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd4BUxeEH8HfHcXf03ouIUizYCxZUAiK22EVFDYodNZqoxFgSa+zlpzH2ir2X\niA1BxcQaxQKoiChFer/j+v7+uGNBuNtrewXm8/lrdt+8t7NvdnaP92XmpcRisQgAAAAAAAAI\nQ2pdNwAAAAAAAACoPQJCAAAAAAAACIiAEAAAAAAAAAIiIAQAAAAAAICACAgBAAAAAAAgIAJC\nAAAAAAAACIiAEAAAAAAAAAIiIAQAAAAAAICACAgBAAAAAAAgIAJCAAAAAAAACIiAEAAAAAAA\nAAIiIAQAAAAAAICACAgBAAAAAAAgIAJCAAAAAAAACIiAEAAAAAAAAAIiIAQAAAAAAICACAgB\nAAAAAAAgIAJCAAAAAAAACIiAEAAAAAAAAAIiIAQAAAAAAICACAgBAAAAAAAgIAJCAAAAAAAA\nCIiAEAAAAAAAAAIiIAQAAAAAAICACAgBAAAAAAAgIAJCAAAAAAAACIiAEAAAAAAAAAIiIAQA\nAAAAAICACAgBAAAAAAAgIAJCAAAAAAAACIiAEAAAAAAAAAIiIAQAAAAAAICACAgBAAAAAAAg\nIAJCAAAAAAAACIiAEAAAAAAAAAIiIA