ip the coordinates to make the plot horizontal\n    ylim(y_min, y_max) +  # Set the limits of the y-axis\n    theme(\n        plot.title = element_text(size = 25),  # Adjust title size\n        plot.margin = margin(50, 50, 50, 50)  # Adjust plot margins\n    )","metadata":{"execution":{"iopub.status.busy":"2024-03-10T05:34:35.343955Z","iopub.execute_input":"2024-03-10T05:34:35.345537Z","iopub.status.idle":"2024-03-10T05:34:50.088303Z"},"trusted":true},"execution_count":106,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22mRemoved 246063 rows containing non-finite values (`stat_boxplot()`).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAANICAIAAADMoEMsAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ5xVxcEH4LN96R2kiJViF6xRsQTBHkssUdQoxFijRDHE3o01GqO+diNBo4nY\no6IiiCV2RRFQEVGq9LYsW+/7YXfvrsvu3V5gnufT7D1z5865M+cefufPmZMUi8UiAAAAAAAA\nIAzJTd0BAAAAAAAAoPEICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAI\nCAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAA\nAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIg\nBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAA\nACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQ\nAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAA\ngIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIA\nAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAA\nAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEA\nAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAI\niIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAA\nAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAg\nAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAA\nAAAAAiIgBAAAAAAAgIAICAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBAAAAAAAgIAI\nCAEAAAAAACAgAkIAAAAAAAAIiIAQAAAAAAAAAiIgBA